-- Insertion des familles (si la famille est la même, tu peux la réutiliser)
WITH first_insert AS (
    INSERT INTO family (name, color, image_content, image_content_type)
    VALUES ('Kong', '#F7EF05',
    '\',
    'image/jpeg')
    RETURNING id_family
),

-- Insertion de 'Diddy' dans la table 'member' et récupération de l'ID du membre
second_insert AS (
    INSERT INTO member (name, color, id_family, image_content, image_content_type)
    SELECT 'Diddy', '#E60514', id_family,
    '\',
    'image/jpeg' 
    FROM first_insert
    RETURNING id_member
),

-- Insertion dans la table 'account_member' pour 'Diddy'
third_insert AS (
    INSERT INTO account_member (id_member, email, password_hash)
    SELECT id_member, 'diddy_kong@banana.com', 
        '$2a$10$42/27sPyWj/38c2cnJ1iyu7U14Yh5gTA/lylT1r5Hr9LMddXQGFZO'  
    FROM second_insert
    RETURNING id_member
),

-- Insertion de l'événement pour 'Diddy'
fourth_insert AS (
    INSERT INTO event (name, description, isVisible, id_family)
    SELECT 'Cadeau pour Dixie', 'Acheter le cadeau pour Dixie.', false, id_family FROM first_insert
    RETURNING id_event
),

-- Insertion de la période pour l'événement de 'Diddy'
fifth_insert AS (
    INSERT INTO period (start_date_time, end_date_time, id_event)
    SELECT '2024-10-23 18:00:00', '2024-10-23 18:15:00', id_event
    FROM fourth_insert
    RETURNING id_event
),

-- Insertion dans 'Participation' pour 'Diddy'
participation_diddy AS (
    INSERT INTO Participation (id_member, id_event)
    SELECT id_member, id_event
    FROM second_insert, fourth_insert
),

-- Insertion de l'événement "Biblio" pour 'Diddy'
biblio_event AS (
    INSERT INTO event (name, description, isVisible, id_family)
    SELECT 'Biblio', 'Aller porter mes 2 livres', true, id_family FROM first_insert
    RETURNING id_event
),

-- Insertion de la période pour l'événement "Biblio"
biblio_period AS (
    INSERT INTO period (start_date_time, end_date_time, id_event)
    SELECT '2024-11-05 17:00:00', '2024-11-05 17:15:00', id_event
    FROM biblio_event
    RETURNING id_event
),

-- Insertion dans 'Participation' pour 'Diddy' pour l'événement "Biblio"
participation_biblio AS (
    INSERT INTO Participation (id_member, id_event)
    SELECT id_member, id_event
    FROM second_insert, biblio_event
),

-- Insertion de l'événement "Garage" pour 'Diddy'
garage_event AS (
    INSERT INTO event (name, description, isVisible, id_family)
    SELECT 'Garage', 'Changement de pneus', true, id_family FROM first_insert
    RETURNING id_event
),

-- Insertion de la période pour l'événement "Garage"
garage_period AS (
    INSERT INTO period (start_date_time, end_date_time, id_event)
    SELECT '2024-11-05 08:30:00', '2024-11-05 10:00:00', id_event
    FROM garage_event
    RETURNING id_event
),

-- Insertion dans 'Participation' pour 'Diddy' pour l'événement "Garage"
participation_garage AS (
    INSERT INTO Participation (id_member, id_event)
    SELECT id_member, id_event
    FROM second_insert, garage_event
),

alert_garage AS (
    INSERT INTO alert (date_time, id_event)
    SELECT '2024-11-05 07:30:00', id_event
    FROM garage_event
),

-- Insertion de 'Dixie' dans la table 'member'
dixie_member AS (
    INSERT INTO member (name, color, id_family)
    SELECT 'Dixie', '#E677C6', id_family FROM first_insert
    RETURNING id_member
),

-- Insertion dans la table 'account_member' pour 'Dixie'
dixie_account AS (
    INSERT INTO account_member (id_member, email, password_hash)
    SELECT id_member, 'dixie_kong@banana.com', 
        '$2a$10$42/27sPyWj/38c2cnJ1iyu7U14Yh5gTA/lylT1r5Hr9LMddXQGFZO'
    FROM dixie_member
    RETURNING id_member
),

-- Insertion de l'événement pour 'Dixie'
dixie_event AS (
    INSERT INTO event (name, description, isVisible, id_family)
    SELECT 'Concert', 'Aller au concert du soir.', true, id_family FROM first_insert
    RETURNING id_event
),

-- Insertion de la période pour l'événement de 'Dixie'
dixie_period AS (
    INSERT INTO period (start_date_time, end_date_time, id_event)
    SELECT '2024-11-16 20:00:00', '2024-11-16 22:00:00', id_event
    FROM dixie_event
    RETURNING id_event
)

-- Insertion de la participation de Dixie à son propre événement et de Diddy à l'événement de Dixie
INSERT INTO Participation (id_member, id_event)
SELECT dixie_member.id_member, dixie_event.id_event FROM dixie_member, dixie_event
UNION
SELECT second_insert.id_member, dixie_event.id_event FROM second_insert, dixie_event;
